  false,\n\t\"url\": null,\n\t\"notes\": \"USGS Contract Number: G10PC00093, Task
  Order: G14PD00222 Digital Aerial Solutions LLC was tasked to collect and process
  4607 sq. miles of Light Detection and Ranging (LiDAR) dataset in Virginia. The LiDAR
  Survey encompasses 4607 sq. miles of area in Eastern Virginia inclusive of the counties
  and cities of Spotsylvania, Caroline, Hanover, Henrico, Chesterfield, Dinwiddie,
  Sussex, Richmond City, Hopewell City, Colonial Heights City, Petersburg City, portions
  of Orange and Louisa, Amelia, Nottoway and Prince Edward. The LiDAR point cloud
  was flown at a nominal post spacing of 0.7 meters for un-obscured areas. The LiDAR
  data and derivative products produced are in compliance with the U.S. Geological
  Survey National Geospatial Program Guidelines and Base Specifications, Version 1.0.
  The final LAS point cloud classified as 1-Unclassified, 2-Ground, 7-Noise, 9-Water,
  10-Ignored Ground due to breakline proximity, 17-overlap ground points and 18 -
  overlap unclassified points. The GPS Survey was completed by ESP Associates for
  3 block acquisition area, and 2 blocks acquisition area by Michale Baker Surveying
  totaling 4607 square miles through the project area. Breaklines were delivered with
  the lidar dataset. These have not been reviewed by NOAA OCM, therefore are only
  available by request.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
